import React from 'react';
import './styles/Home.css';

function Home() {
  return (
    <section className="home">
      <div className="intro">
        <h1>Welcome to My Personal Website</h1>
        <p>Hi, I'm <strong>Your Name</strong>, a passionate Full Stack Developer specializing in building and designing exceptional digital experiences. With expertise in both front-end and back-end technologies, I create seamless and efficient web applications that meet client needs and exceed expectations.</p>
        <p>Feel free to explore my portfolio, learn more about my skills and experience, and don't hesitate to reach out if you'd like to work together.</p>
      </div>
      <div className="home-image">
        <img src="your-image-url.jpg" alt="Your Name" />
      </div>
    </section>
  );
}

export default Home;
